import React, { useEffect, useState } from 'react'
import { useNavigate } from "react-router-dom";
// import logo from "../images/Logo-navbar.png"
import "../css/Doctor.css"
export default function Doctor() {

    document.body.style.backgroundImage = "none";
    document.body.style.backgroundColor = "rgb(84, 139, 187)"

    const navigate = useNavigate();
    // const [xyz, setXyz] = useState([]);
    const [cat, setcat] = useState([])
    // var array;


    useEffect(() => {

        // console.log('use effect called , call API');

        fetch('http://localhost:8080/doctor/allDoctors')
            .then(res => res.json())
            .then(valueFromAPI => {
                console.log('API DATA CALLED');
                console.log(valueFromAPI);
                setcat(valueFromAPI)

            })
    }, []);

    var M1 = () => {

        var email1 = document.getElementById("exampleInputEmail1").value;
        var password = document.getElementById("exampleInputPassword1").value;
        console.log(email1);
        console.log(password);
        var b = false;
        cat.forEach(element => {
            // console.log(element.email);
            if(email1 === element.email && password === element.password){
                b = true;
            }
            else {
                b = false;
            }
       });
       if(b === true){
        navigate("/doctor-home");
       }
       else{
        navigate("/doctor");
       }
    }

    return (
        <div className="container-fluid w-25 p-3 h-100 mt-5 ">

            <form className="form-control-md">
                <h1 className="text-center mb-4 display-5">Login</h1>
                <div className="mb-3">
                    <label for="exampleInputEmail1" className="form-label">Email address</label>
                    <input type="text" value="" className="form-control" id="exampleInputEmail1" />
                </div>
                <div className="mb-3">
                    <label for="exampleInputPassword1" className="form-label">Password</label>
                    <input type="password" value="password" className="form-control" id="exampleInputPassword1" />
                    
                </div>
                <div className="text-center">
                    <button type="submit" className="btn btn-secondary" onClick={M1}>Login</button>
                </div>
            </form>
            
        </div>


    )
}
